INSERT INTO `post` VALUES (20,'Pengumuman Cimahi Digital Festival 2023','pengumuman-cimahi-digital-festival-2023','<p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2023-11-06 at 18.03.34_8f00283a.jpg\" style=\"width: 50%;\"><br></p><p>Disampaikan, mari Akang dan Teteh para penggiat industri animasi dan telematika di Kota Cimahi untuk bergabung dalam kegiatan Cimahi Digital Festival tahun 2023 karena akan terdapat beberapa kegiatan kompetisi seperti:&nbsp;</p><p><br></p><p>1. Kompetisi inovasi produk Telematika.&nbsp;</p><p>2. Kompetisi pembiayaan usaha sektor Telematika.</p><p>3. Kompetisi inovasi produk animasi.</p><p>4. Kompetisi pembiayaan usaha sektor animasi.</p><p>5. Kompetisi cosplay.</p><p><br></p><p>Disamping itu juga ada talkshow, pameran dan Investment pitching...</p>',0,19,'2023-11-06 16:41:06','2023-11-06 16:41:06');
